            {O F F E R I N G}
One 0.8mm wide handmade 14K solid palladium knuckle ring. This ring is the epitome of thin and dainty!  Since this ring is handmade, sometimes there will be small hammer or file marks.
We are happy to finish your band with either a mirror polish (as photographed) or with a matte finish.  Please leave a message in the Notes to Seller box at checkout indicating your preference.  If no preference is specified, we will finish the band with a mirror polish.
